    return sum(1 for nd in opt.g.nodes if not nd.is_anchor_node), sum(1 for ed in opt.g.edges if not ed.n1.is_anchor_node), opt.g.n_nodes, len(opt.g.edges), res.objval, gcr, bnds, res.runtime, res.status


